import styled from 'styled-components';
import { darken } from 'polished';

export const Container = styled.div`
  max-width: 600px;
  margin: 50px auto;
  display: flex;
  justify-content: center;
  flex-direction: column;

  header {
    display: flex;
    align-self: center;
    align-items: center;


  }
`;

export const List = styled.li`
  padding: 20px;
  border-radius: 4px;
  background: #fff;

  strong {
    display: block;
    color: #7159c1;
    font-size: 20px;
    font-weight: normal;

  }

  span {
    display: block;
    margin-top:3px;
    color:#666;

  }
`;
